import domReady from"@wordpress/dom-ready";function upgradeToProLink(){const upgradeLinkEl=document.querySelector('#adminmenu a[href^="https://wpcharitable.com/lite-vs-pro"]');if(!upgradeLinkEl){return}upgradeLinkEl.setAttribute("target","_blank")}function fiveStarRatingNotice(){const steps=document.querySelectorAll(".charitable-admin-notice-five-star-rating");steps.forEach((stepEl=>{const navigationEls=stepEl.querySelectorAll("[data-navigate]");if(!navigationEls){return}navigationEls.forEach((navigationEl=>{navigationEl.addEventListener("click",(({target:target})=>{const step=target.dataset.navigate;const stepToShow=document.querySelector(`.charitable-admin-notice-five-star-rating[data-step="${step}"]`);const stepsToHide=document.querySelectorAll(`.charitable-admin-notice-five-star-rating:not([data-step="${step}"])`);if(stepToShow){stepToShow.style.display="block"}if(stepsToHide.length>0){stepsToHide.forEach((stepToHide=>{stepToHide.style.display="none"}))}}))}))}))}domReady((()=>{upgradeToProLink();jQuery(".charitable-notice").each((function(){const notice=jQuery(this);const noticeId=notice.data("id");const nonce=notice.data("nonce");const lifespan=notice.data("lifespan");notice.on("click",".notice-dismiss, .charitable-notice-dismiss",(()=>{wp.ajax.send("charitable_dismiss_admin_notice",{data:{notice_id:noticeId,nonce:nonce,lifespan:lifespan},success(){notice.slideUp("fast");const{uid:uid=0}=userSettings;const seenKey=`charitable-notice-${noticeId}-seen-${uid}`;window.localStorage.removeItem(seenKey)}})}))}));const topOfPageNotice=jQuery(".charitable-admin-notice-top-of-page");if(topOfPageNotice.length>0){const topOfPageNoticeEl=topOfPageNotice.detach();jQuery("#wpbody-content").prepend(topOfPageNoticeEl);const{uid:uid=0}=userSettings;const noticeId=topOfPageNoticeEl.data("id");const seenKey=`charitable-notice-${noticeId}-seen-${uid}`;if(window.localStorage.getItem(seenKey)){topOfPageNoticeEl.show()}else{setTimeout((()=>{window.localStorage.setItem(seenKey,true);topOfPageNotice.slideDown()}),1500)}}}));